import CardList from './CardList';
import {Profile} from './Profile'
import SearchBox from './SearchBox';
const App=()=>{
        return(
            <div className="tc">
                <h1 className="">Shortlisted Profile's</h1>
                <SearchBox/>
                <CardList Profile={Profile}/>
            </div>
        );
    }
export default App;
